package org.springframework.samples.petclinic.vet;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import java.time.LocalDate;
import static org.junit.jupiter.api.Assertions.*;
import java.util.ArrayList;
import org.springframework.samples.petclinic.vet.Vet;
import org.springframework.samples.petclinic.vet.Vets;
import static org.junit.jupiter.api.Assertions.*;
import java.util.List;
import java.lang.reflect.Field;
import org.junit.jupiter.api.Test;

class VetsTest {

	private Vets instance;

	@BeforeEach
	void setUp() {
		instance = new Vets();
	}

	@Test
	@DisplayName("Verifies that getVetList returns the existing list without re-initialization if vets is already set")
	void testGetVetListReturnsExistingList() {
		Vets vetsInstance = new Vets();
		try {
			Field vetsField = Vets.class.getDeclaredField("vets");
			vetsField.setAccessible(true);
			List<Vet> existingList = new ArrayList<>();
			existingList.add(new Vet());
			vetsField.set(vetsInstance, existingList);
			List<Vet> result = vetsInstance.getVetList();
			assertNotNull(result);
			assertSame(existingList, result);
		}
		catch (NoSuchFieldException | IllegalAccessException e) {
			fail("Reflection failed: " + e.getMessage());
		}
	}

	@Test
	@DisplayName("Verifies that multiple calls to getVetList return the same list object, ensuring lazy initialization")
	void testGetVetListMultipleCallsReturnSameObject() {
		List<Vet> result1 = instance.getVetList();
		List<Vet> result2 = instance.getVetList();
		assertNotNull(result1);
		assertNotNull(result2);
		assertSame(result1, result2);
	}

}
